import './General.css';

const General = () => {
    return (
        <div className="general-template-wrapper">
            <div className="title">
                <h2>기본 설정</h2>
                <p></p>
            </div>
            <div className="content">
                <ul className="general">
                    <li className="theme">
                        <span className="text">다크 테마</span>
                        <label className="switch">
                            <input type="checkbox" name="theme"></input>
                            <span className="slider round"></span>
                        </label>
                    </li>
                </ul>
            </div>
        </div>
    );
}

export default General;
